import { Container } from '@mui/system'
import { Button, Checkbox, TextField, FormGroup, FormControlLabel } from '@mui/material';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';


function AddUser() {
  const navigate = useNavigate();
  const [userData, setUserData] = useState({ firstName: String, lastName: String, username: String, sessionTimeOut: Number, createdData: new Date().toLocaleDateString('en-CA'), permissions: [] });
  const [checkboxValues, setCheckboxValues] = useState([]);

  const handleCheckboxChange = (e)=>{
    e.preventDefault();
    if (e.target.checked) {
      // If the checkbox is checked, add the value to the array
      if (!checkboxValues.includes(e.target.checked)) {
        setCheckboxValues(prevValues => [...prevValues, e.target.checked]);
      }
    } else {
      // If the checkbox is unchecked, remove the value from the array
      setCheckboxValues(prevValues => prevValues.filter(val => val !== e.target.value));
    }
    userData.permissions=checkboxValues;
    console.log(userData.permissions)
  }
  const handleLabelClick = (e) => {
    // Get the checkbox value associated with the clicked label
    const value = e.target.htmlFor;
    const checked = checkboxValues.includes(value);

    // If the checkbox is currently checked, uncheck it
    if (checked) {
      setCheckboxValues(prevValues => prevValues.filter(val => val !== value));
    }
  }




  const handleSubmit = async (e) => {
    e.preventDefault();
    //Save User to DB

  }
  return (
    <Container>
      <h3>Add New Users</h3>
      <TextField sx={{ padding: 1, marginTop: 0.5 }} required label=" First Name" id="outlined-first-name" onChange={(e) => setUserData({ ...userData, firstName: e.target.value })} /><br />
      <TextField sx={{ padding: 1, marginTop: 0.5 }} required label=" Last Name" id="outlined-last-name" onChange={(e) => setUserData({ ...userData, lastName: e.target.value })} /><br />
      <TextField sx={{ padding: 1, marginTop: 0.5 }} required label=" User Name" id="outlined-last-name" onChange={(e) => setUserData({ ...userData, username: e.target.value })} /><br />
      <TextField sx={{ padding: 1, marginTop: 0.5 }} required label="Session Time Out (minutes)" id="outlined-session-time-out" onChange={(e) => setUserData({ ...userData, sessionTimeOut: e.target.value })} /><br />
      <FormGroup>
        <FormControlLabel control={<Checkbox value="View Subscriptions"   onChange={handleCheckboxChange}/>} label="View Subscriptions" onClick={handleLabelClick}/>
        <FormControlLabel control={<Checkbox value="Create Subscriptions"  onChange={handleCheckboxChange} />} label="Create Subscriptions" onClick={handleLabelClick}/>
        <FormControlLabel control={<Checkbox value="Delete Subscriptions"  onChange={handleCheckboxChange}/>} label="Delete Subscriptions" onClick={handleLabelClick}/>
        <FormControlLabel control={<Checkbox value="Update Subscriptions"  onChange={handleCheckboxChange}/>} label="Update Subscriptions"onClick={handleLabelClick} />
        <FormControlLabel control={<Checkbox value="View Movies"  onChange={handleCheckboxChange}/>} label="View Movies" onClick={handleLabelClick}/>
        <FormControlLabel control={<Checkbox value="Create Movies"  onChange={handleCheckboxChange}/>} label="Create Movies" onClick={handleLabelClick}/>
        <FormControlLabel control={<Checkbox value="Delete Movies"  onChange={handleCheckboxChange}/>} label="Delete Movies" onClick={handleLabelClick}/>
        <FormControlLabel control={<Checkbox value="Update Movies"  onChange={handleCheckboxChange}/>} label="Update Movies" onClick={handleLabelClick}/>
      </FormGroup>
      <Button sx={{ padding: 1, marginTop: 2 }} variant="outlined" type='submit' onClick={handleSubmit}>Save</Button>
      <Button sx={{ padding: 1, marginTop: 2, marginLeft: 2 }} variant="outlined" type='submit' onClick={() => navigate('/mainPage/usersManagement/usersData')}>Cancel</Button>
    </Container>
  );
}

export default AddUser;
